import React, { useState, useEffect } from 'react'

const Table = (rows) => {

    var fieldNames = []
    if(rows.length !== 0){
        fieldNames = Object.keys(rows[0])
    }
    fieldNames.shift()
    
    return (
        <table>
            <thead>
            <tr>
            {fieldNames.map(fieldName => (
                <th key={fieldName}>{fieldName}</th>
            ))}
                </tr>
            </thead>
            <tbody>
                {rows.map(row => (
                    <tr key={row._id}>
                    {fieldNames.map(fieldName => (
                        <td key={fieldName}>{row[fieldName]}</td>
                    ))}
                    </tr>
                ))}
            </tbody>
        </table>
    )
    
}

export default Table
